import axios from 'axios';

export default{
    findAll: function(){
        return axios.get('/api/calculator/list');
    },
    limit: function(){
        return axios.get('api/calculator/limit');
    },
    save: function(data){
        console.log("hit the route", data)
        return axios.post('api/calculator/save', data)
    }

}
